import React from 'react';
import { ChartData, renderCustomizedLabel } from '../utils/utils';
import {
  ResponsiveContainer,
  Pie,
  PieChart,
} from "recharts";

const TranslucentPieChart: React.FC<ChartData> = ({ chartData }) => {
    return (
        <ResponsiveContainer width="100%" maxWidth={700} height={400}>
            <PieChart style={{ width: '100%' }}>
                <Pie
                    data={chartData}
                    labelLine={false}
                    label={renderCustomizedLabel}
                    fill="#8884d8"
                    dataKey="count"
                    nameKey="department"
                />
            </PieChart>
        </ResponsiveContainer>
    );
};

export default TranslucentPieChart;
